import React, { useState } from 'react';

function ProjectList({ projects, onAddProject, onSelectProject }) {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    startDate: '',
    endDate: '',
    milestone: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.name.trim()) {
      onAddProject(formData);
      setFormData({ name: '', description: '', startDate: '', endDate: '', milestone: '' });
      setShowForm(false);
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <div>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '2rem' }}>
        <h2>Projects</h2>
        <button className="btn btn-success" onClick={() => setShowForm(!showForm)}>
          {showForm ? 'Cancel' : 'New Project'}
        </button>
      </div>

      {showForm && (
        <div className="card">
          <h3>Create New Project</h3>
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>Project Name</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>
            <div className="form-group">
              <label>Description</label>
              <textarea
                name="description"
                value={formData.description}
                onChange={handleChange}
              />
            </div>
            <div className="grid grid-2">
              <div className="form-group">
                <label>Start Date</label>
                <input
                  type="date"
                  name="startDate"
                  value={formData.startDate}
                  onChange={handleChange}
                />
              </div>
              <div className="form-group">
                <label>End Date</label>
                <input
                  type="date"
                  name="endDate"
                  value={formData.endDate}
                  onChange={handleChange}
                />
              </div>
            </div>
            <div className="form-group">
              <label>Milestone</label>
              <input
                type="text"
                name="milestone"
                value={formData.milestone}
                onChange={handleChange}
                placeholder="e.g., MVP Release, Beta Launch"
              />
            </div>
            <button type="submit" className="btn btn-success">Create Project</button>
          </form>
        </div>
      )}

      <div className="grid grid-2">
        {projects.length === 0 ? (
          <div className="card">
            <p style={{ textAlign: 'center', color: '#666', fontStyle: 'italic' }}>
              No projects yet. Create your first project to get started!
            </p>
          </div>
        ) : (
          projects.map(project => (
            <div key={project.id} className="card" style={{ cursor: 'pointer' }} onClick={() => onSelectProject(project)}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', marginBottom: '1rem' }}>
                <h3>{project.name}</h3>
                <span className={`status-badge status-${project.status.toLowerCase().replace(' ', '-')}`}>
                  {project.status}
                </span>
              </div>
              <p style={{ color: '#666', marginBottom: '1rem' }}>{project.description}</p>
              {project.milestone && (
                <div style={{ marginBottom: '1rem' }}>
                  <strong>Milestone:</strong> {project.milestone}
                </div>
              )}
              <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: '0.9rem', color: '#666' }}>
                <span>Start: {project.startDate || 'Not set'}</span>
                <span>End: {project.endDate || 'Not set'}</span>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
}

export default ProjectList;
